import React from 'react';

const ShopNav = () => {
    return (
        <div className='shop-nav'>
            <ul className='shop-links'>
                <li>Category 1</li>
                <li>Category 2</li>
                <li>Category 3</li>
                <li>Category 4</li>
                <li>Cart</li>
            </ul>
        </div>
    );
};

export default ShopNav;
